                <span className="close_bt"><ion-icon name="close"></ion-icon></span>
                <div className="Indi_thnx"><span onClick={changer} className="check_icon"><ion-icon name="checkmark-circle"></ion-icon></span></div>
                <div className="Msg">Message Sent!<br></br>I'll get back to you soon.</div>
            </div>
        </Fragment>
    );

};

